def pattern_matching_count(text, pattern):
    text_it = 0
    indices = []

    while text_it <= len(text) - 1:
        count = 0
        prev = text_it
        if text[text_it] == pattern[0]:
            text_it += 1
            count += 1
            for i in range(1, len(pattern)):
                if text_it >= len(text):
                    break
                if text[text_it] == pattern[i]:
                    count += 1
                    text_it += 1
            if count == len(pattern):
                indices.append(text_it - count)
            else:
                count = 0
                text_it -= len(pattern)

        text_it = prev + 1

    return indices

res = pattern_matching_count("", "CTTGATCAT")
res_str = ""
for i in range(0, len(res)):
    res_str += str(res[i])
